import React from 'react'
import './Home.css'
import FlightIcon from '@mui/icons-material/Flight';

const Home = () => {
  return (
    <div className="home-nav">
      <div className="select">
        <button><FlightIcon/></button>
      </div>

    </div>
  )
}

export default Home
